string m(int q) {
	char a[q], b[q], p1, p2;
	cin >> a>>b;
	int p = 0;
	for (int i = 0; i != q; i++) {
		if(a[i]!=b[i]) {
			if(p==1) {
				if(p1!=a[i]||p2!=b[i]) {
					return "No";
				}
			}
			p1=a[i];p2 = b[i];
			p++;
		}
	}
	if(p==2)return "Yes";
	else {return "No";}
}
int main() {
	int n;
	cin >> n;
	string a[n];
	for (int i =0; i < n; i++) {
		int n1;cin >> n1;
		a[i] = m(n1);
	}for (int i = 0; i < n; i++) {
		cout << a[i] << endl;
	}
}
