['#include<stdio.h>
int main()
{
	int n, t, f, x, y, i;
	
	scanf("%d", &t);
	
	while(t--)
	{
		scanf("%d", &n);
		char s[n+1], k[n+1];
		f=0;
		
		scanf("%s %s", s, k);
		
		for(i=0; i<n; i++)
		{
			if(s[i]!=k[i])
			{
				f++;
				
				if(f==1){
					x=i;
				}
				if(f==2){
					y=i;
				}
			}
		}
		if(f==0)
		{
			printf("Yes\n");
		}
		else if(f==2)
		{
			if(s[x]==s[y] && k[x]==k[y])
			{
				printf("Yes\n");
			}
			else
			{
				printf("No\n");
			}
		}
		else
		{
			printf("No\n");
		}
	}
	return 0;
}']

