['#include<stdio.h>
#include<string.h>
int main()
{
    int k,n,i,count,j;
    scanf("%d",&k);
    char s1[1010],s2[1010];

    while(k--)
    {
        scanf("%d%s%s",&n,&s1,&s2);
        i=0;
        count=0;
        while(s1[i]!='\0')
        {
            if(s1[i]!=s2[i])
            {
                j=i+1;
                while(s1[j]==s2[j])
                    j++;
                if(s1[i]!=s1[j]||s2[i]!=s2[j])
                    count=1;
                break;
            }
            i++;
        }
        if(count==0)
            printf("YES\n");
        else
            printf("NO\n");
    }
    return 0;
}']

