{
    int k,n,i;
    scanf("%d",&k);
    for(i=1;i<=k;i=i+1)
    {
        scanf("%d",&n);
        char s[n+1],t[n+1],q,r;
        scanf("%s %s",&s,&t);
        int j=0,p=0,v=0;
        while(s[j]!=0)
        {
            if(s[j]!=t[j])
            {
                p=p+1;
            }
            j=j+1;
        }
        if(p==0)
        {
            printf("Yes\n");
        }
        else if(p==2)
        {
            int j=0;
            while(s[j]!=0)
            {
                if(s[j]!=t[j])
                {
                    if(v==0)
                    {
                    q=t[j];
                    r=s[j];
                    v=1;
                    }
                    else
                    {
                        if(q==t[j] && r==s[j])
                        {
                            printf("Yes\n");
                        }
                        else
                        {
                            printf("No\n");
                        }
                    }
                }
                j=j+1;
            }
        }
        else
        {
            printf("No\n");
        }
    }
}']

