['#include<stdio.h>
#include<stdlib.h>

int cf(void const *a, void const *b)
{
	return (*(int*)a - *(int*)b);
}
int main()
{
	int t, n, i, k;
	
	scanf("%d", &t);
	
	while(t--)
	{
		scanf("%d", &n);
		int a[n+1], r=0, f=0;
		
		for(i=0; i<n; i++)
		{
			scanf("%d", &a[i]);
		}
		qsort(a, n, sizeof(int), cf);
		
		for(k=n-1; k>=0; k--)
		{
			r++;
			if(r>a[k]){
				f=1;
				break;
			}
		}
		if(f==1){
			printf("%d\n", r-1);
		}
		else{
			printf("%d\n", r);
		}
	}
	return 0;
}']

