['#include<stdio.h>
int main()
{

    int t;
    scanf("%d",&t);
    for(int z=0;z<t;z++)
    {
        int n,large=0,small=10001,flag=1;
        scanf("%d",&n);
        int arr[n];

        for(int i=0;i<n;i++)
        {
            scanf("%d",&arr[i]);

            if(large<arr[i])
                large=arr[i];

            if(small>arr[i])
                small=arr[i];
        }

        while(flag==1&&large>=small)
        {
            int j=0;
            for(int i=0;i<n;i++)
            {
                if(arr[i]>=large)
                {
                    j++;
                }
                if(j>=large)
                {
                    printf("%d\n",large);
                    flag=0;
                    break;
                }
            }
            large--;
        }
    }
}

